const TabNavigator = createMaterialTopTabNavigator(
  {
    Tortas: {
      screen: TortasScreen,
      navigationOptions: {
        tabBarLabel: 'Tortas',
        tabBarIcon: ({ tintColor }) => <Entypo name="cake" size={24} color={tintColor} />,
      },
    },
    Home: {
      screen: HomeScreen,
      navigationOptions: {
        tabBarLabel: 'Inicio',
        tabBarIcon: ({ tintColor }) => <Entypo name="home" size={24} color={tintColor} />,
      },
    },
    IngredientList: {
      screen: IngredientListScreen,
      navigationOptions: {
        tabBarLabel: 'Ingredientes',
        tabBarIcon: ({ tintColor }) => <Entypo name="list" size={24} color={tintColor} />,
      },
    },
  },
  {
    tabBarPosition: 'bottom',
    tabBarOptions: {
      activeTintColor: '#86C997',
      inactiveTintColor: 'gray',
      labelStyle: {
        fontSize: 12,
        fontWeight: 'bold',
      },
      style: styles.tabBar,
      indicatorStyle: {
        backgroundColor: '#86C997',
      },
    },
  }
);

const AppContainer = createAppContainer(TabNavigator);

const Navigation = () => {
  return (
    <View style={styles.container}>
      <Image
        source={{ uri: 'https://example.com/path/to/background-image.png' }} // Reemplaza con la URL de la imagen de fondo deseada
        style={styles.backgroundImage}
        resizeMode="cover"
      />
      <AppContainer />
    </View>
  );
};

export default Navigation;
